import React from 'react';
import { Container, Row, Col } from 'react-bootstrap';
import { VerticalTimeline, VerticalTimelineElement } from 'react-vertical-timeline-component';
import 'react-vertical-timeline-component/style.min.css';

export const Education = () => {
    return (
        <div id="Education">


            <Container>
                <div className='mt-4 d-flex justify-content-center' ><h1>EDUCATION</h1></div>
                <div className='my-4'>

                    <VerticalTimeline lineColor={"black"}>
                        <VerticalTimelineElement
                            className="vertical-timeline-element--work"
                            date="Jan 2024 - March 2024"
                            contentStyle={{ background: ' #a8d8b9', color: '#fff' }}
                            contentArrowStyle={{ borderRight: "7px solid #a8d8b9" }}
                            iconStyle={{ background: " #a8d8b9", color: "#fff" }}
                        //    icon={<WorkIcon />}
                        >
                            <h3 className="vertical-timeline-element-title text-dark">PENETRATION TESTER INTERN</h3>
                            <h4 className="vertical-timeline-element-subtitle text-dark">
                                HackersForYou
                            </h4>
                            <p className='text-white-1000 fs-3'>• Web App Penetration testing <br />
                                • Report creating</p>
                        </VerticalTimelineElement>
                        <VerticalTimelineElement
                            className="vertical-timeline-element--work"
                            date="2010 - 2011"
                            contentStyle={{ borderTop: "3px solid  rgb(33, 150, 243)" }}
                            contentArrowStyle={{ borderRight: "7px solid  rgb(33, 150, 243)" }}
                            iconStyle={{ background: "rgb(33, 150, 243)", color: "#fff" }}
                        //    icon={<WorkIcon />}
                        >
                            <h3 className="vertical-timeline-element-title">Art Director</h3>
                            <h4 className="vertical-timeline-element-subtitle">
                                San Francisco, CA
                            </h4>
                            <p>
                                Creative Direction, User Experience, Visual Design, SEO, Online
                                Marketing
                            </p>
                        </VerticalTimelineElement>
                        <VerticalTimelineElement
                            className="vertical-timeline-element--work"
                            date="2008 - 2010"
                            contentStyle={{ borderTop: "3px solid  rgb(33, 150, 243)" }}
                            contentArrowStyle={{ borderRight: "7px solid  rgb(33, 150, 243)" }}
                            iconStyle={{ background: "rgb(33, 150, 243)", color: "#fff" }}
                        //    icon={<WorkIcon />}
                        >
                            <h3 className="vertical-timeline-element-title">Web Designer</h3>
                            <h4 className="vertical-timeline-element-subtitle">
                                Los Angeles, CA
                            </h4>
                            <p>User Experience, Visual Design</p>
                        </VerticalTimelineElement>
                        <VerticalTimelineElement
                            className="vertical-timeline-element--work"
                            date="2006 - 2008"
                            contentStyle={{ borderTop: "3px solid  rgb(33, 150, 243)" }}
                            contentArrowStyle={{ borderRight: "7px solid  rgb(33, 150, 243)" }}
                            iconStyle={{ background: "rgb(33, 150, 243)", color: "#fff" }}
                        //    icon={<WorkIcon />}
                        >
                            <h3 className="vertical-timeline-element-title">Web Designer</h3>
                            <h4 className="vertical-timeline-element-subtitle">
                                San Francisco, CA
                            </h4>
                            <p>User Experience, Visual Design</p>
                        </VerticalTimelineElement>
                        <VerticalTimelineElement
                            className="vertical-timeline-element--education"
                            date="April 2013"
                            contentStyle={{ borderTop: "3px solid  rgb(33, 150, 243)" }}
                            contentArrowStyle={{ borderRight: "7px solid  rgb(33, 150, 243)" }}
                            iconStyle={{ background: "rgb(33, 150, 243)", color: "#fff" }}
                        //    icon={<SchoolIcon />}
                        >
                            <h3 className="vertical-timeline-element-title">
                                Content Marketing for Web, Mobile and Social Media
                            </h3>
                            <h4 className="vertical-timeline-element-subtitle">
                                Online Course
                            </h4>
                            <p>Strategy, Social Media</p>
                        </VerticalTimelineElement>
                        <VerticalTimelineElement
                            className="vertical-timeline-element--education"
                            date="November 2012"
                            contentStyle={{ borderTop: "3px solid  rgb(33, 150, 243)" }}
                            contentArrowStyle={{ borderRight: "7px solid  rgb(33, 150, 243)" }}
                            iconStyle={{ background: "rgb(33, 150, 243)", color: "#fff" }}
                        //    icon={<SchoolIcon />}
                        >
                            <h3 className="vertical-timeline-element-title">
                                Agile Development Scrum Master
                            </h3>
                            <h4 className="vertical-timeline-element-subtitle">
                                Certification
                            </h4>
                            <p>Creative Direction, User Experience, Visual Design</p>
                        </VerticalTimelineElement>
                        <VerticalTimelineElement
                            className="vertical-timeline-element--work"
                            date="2002 - 2006"
                            contentStyle={{ borderTop: "3px solid  rgb(33, 150, 243)" }}
                            contentArrowStyle={{ borderRight: "7px solid  rgb(33, 150, 243)" }}
                            iconStyle={{ background: "rgb(33, 150, 243)", color: "#fff" }}
                        //    icon={<SchoolIcon />}
                        >
                            <h3 className="vertical-timeline-element-title">
                                Bachelor of Science in Interactive Digital Media Visual Imaging
                            </h3>
                            <h4 className="vertical-timeline-element-subtitle">
                                Bachelor Degree
                            </h4>
                            <p>Creative Direction, Visual Design</p>
                        </VerticalTimelineElement>
                        <VerticalTimelineElement
                            iconStyle={{ background: "rgb(33, 150, 243)", color: "#fff" }}
                        //    icon={<StarIcon />}
                        />
                    </VerticalTimeline>
                </div>
            </Container>
        </div>
    )
}
